	private static final int NUM = 5;
	private static final int SIZE = 7;
	private static final int WALL = -1;
	private static final int ALPH = 26;
	private static final int START = 'A';
	private static final int[] DIFF = {-SIZE - 1, -SIZE, -SIZE + 1, 1, SIZE + 1, SIZE, SIZE - 1, -1};
	
	private static final class Node {
		boolean isEnd;
		Node[] children;
		
		Node() {
			children = new Node[ALPH];
		}
		
		void add(char[] str) { // 단어 Trie에 추가
			int len, idx, i;
			Node curr, next;
			
			curr = this;
			len = str.length;
			for (i = 0; i < len; i++) { // 단어 길이만큼 트리를 따라 내려가면서 추가
				idx = str[i] - START; // char -> int 변환
				next = curr.children[idx];
				if (next == null) { // 해당 문자로 연결된 자식 노드가 없으면
					next = new Node(); // 새로 만들어서 추가
					curr.children[idx] = next;
				}
				curr = next; // 다음 depth로 이동
			}
			curr.isEnd = true; // 단어의 끝 표시
		}
		
		void search(int pos) { // 단어 검색
			int next, i;
			
			visited[pos] = true; // DFS 방문 처리
			if (isEnd) { // 단어의 끝이면
				cnt++; // 정답 개수 카운트
				isEnd = false; // 단어 중복 방지를 위해 끝 표시 삭제
			}
			for (i = 0; i < 8; i++) {
				next = pos + DIFF[i]; // 다음 좌표
				if (map[next] != WALL && children[map[next]] != null && !visited[next]) {
					children[map[next]].search(next); // 다음 depth로 DFS
				}
			}
			visited[pos] = false; // 원상 복구
		}
	}
	
	private static int cnt;
	private static int map[];
	private static boolean[] visited;
	
	public static void main(String[] args) throws IOException {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st;
		
		int len, i, j;
		char[][] dict;
		Node trie;
		
		init(); // dict 생성
		trie = new Node(); // Trie의 루트 노드
		for (i = 0; i < DICT_NUM; i++) {
			dict = DICT[i];
			len = dict.length;
			for (j = 0; j < len; j++) {
				trie.add(dict[j]); // 모든 단어 Trie에 추가
			}
		}
		map = new int[SIZE * SIZE]; // 1 차원 맵
		for (i = 0; i < SIZE; i++) { // 테두리 벽 세우기
			map[i] = WALL;
			map[i * SIZE] = WALL;
			map[(SIZE - 1) * SIZE + i] = WALL;
			map[i * SIZE + SIZE - 1] = WALL;
		}
		for (i = 1; i <= NUM; i++) {
			st = new StringTokenizer(br.readLine());
			for (j = 1; j <= NUM; j++) {
				map[i * SIZE + j] = st.nextToken().charAt(0) - START; // 퍼즐 char -> int 변환
			}
		}
		cnt = 0; // 정답 개수
		visited = new boolean[SIZE * SIZE]; // DFS 방문 여부
		for (i = 1; i <= NUM; i++) {
			for (j = 1; j <= NUM; j++) {
				trie.children[map[i * SIZE + j]].search(i * SIZE + j); // 탐색하면서 Trie에서 검색
			}
		}
		System.out.print(cnt);
	}
